" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    The effect of the Barnum maneuver in reducing the obstructing part of the fetal shoulder",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 231px; height: 442px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The operator has already inserted a hand into the vagina and delivered the posterior arm by sweeping it across the fetal chest, and thus delivered the posterior shoulder as well (not shown). A 13-cm bisacromial diameter becomes an 11-cm axillo-acromial diameter upon delivery of the arm.",
"    <div class=\"footnotes\">",
