"    Subscription and License Agreement",
"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Bostrom BC, Weisdorf DJ, Kim TH, et al, &ldquo;Bone Marrow Transplantation for Advanced Acute Leukemia: A Pilot Study of High-Energy Total Body Irradiation, Cyclophosphamide and Continuous Infusion Etoposide,&rdquo;",
"      <i>",
"       Bone Marrow Transplant",
"      </i>",
"      , 1990, 5(2):83-9.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?37/62/38886/abstract-text/2107007/pubmed\" id=\"2107007\" target=\"_blank\">",
"        2107007",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      McCune WJ, Golbus J, Zeldes W, et al, &ldquo;Clinical and Immunologic Effects of Monthly Administration of Intravenous Cyclophosphamide in Severe Systemic Lupus Erythematosus,&rdquo;",
"      <i>",
