var title_f37_62_38891="Bacterial skin infections OLT";
var content_f37_62_38891=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F69874&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F69874&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Bacterial skin infections after liver transplantation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Bacteria",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Atypical mycobacteria (M. kansasii, M. chelonae, M. fortuitum, M. marinum)",
"       </td>",
"       <td>",
"        Cutaneous lesions most common on the extremities. Isolated nodules with a violet color, necrotic or even ulcerative. These lesions can appear months to years after transplantation. The possibility of environmental contamination of the cultures, causing false positive results, should be taken into account. Sequencing the hsp65 gene from the skin biopsy may accelerate the diagnosis and improve its accuracy [1].",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nocardia",
"       </td>",
"       <td>",
"        Usually appear as subcutaneous abscesses or nodules in association with other manifestations of disseminated nocardiosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Staphylococcus aureus",
"       </td>",
"       <td>",
"        Responsible for pyoderma, wound infections, and toxic shock syndrome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Treponema pallidum",
"       </td>",
"       <td>",
"        Skin lesions of secondary syphilis accompanying a hepatitis with prolonged fever has been reported following liver transplantation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bartonella henselae",
"       </td>",
"       <td>",
"        Localized bacillary angiomatosis. Skin lesions occur in only 24 percent&nbsp;of cases [2].",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     1. Lau SK, Curreem SO, Ngan AH, et al. First report of disseminated Mycobacterium skin infections in two liver transplant recipients and rapid diagnosis by hsp65 gene sequencing. J Clin Microbiol 2011; 49:3733.",
"     <br>",
"      2. Psarros G, Riddell J 4th, Gandhi T, et al. Bartonella henselae infections in solid organ transplant recipients: report of 5 cases and review of the literature. Medicine (Baltimore) 2012; 91:111.",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
